import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import './App.css';
import Homepage from "./Components/Homepage";
import LoanApplication from "./Components/LoanApplication"; 
import ProductExploration from "./Components/ProductExploration";
import AccountTransactionManagement from "./Components/AccountTransactionManagement";
import CreditCardApplication from "./Components/CreditCardApplication";
import Accountusers from "./Components/Accountusers";
import UpdateUserProfile from "./Components/UpdateUserProfile";

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <nav>
            {/* Links to navigate between components */}
            <Link to="/">Home</Link>
            <Link to="/product-exploration">Product Exploration</Link>
            <Link to="/loan-application">Loan Application</Link>
            <Link to="/account-transaction-management">Transaction Management</Link>
            <Link to="/credit-card-application">Credit Card Application</Link>
            <Link to="/account-users">Account Users</Link>
            <Link to="/update-user-profile">Update User Profile</Link>
          </nav>
        </header>

        <main>
          <Routes>
            {/* Define routes for each component */}
            <Route path="/" element={<Homepage />} />
            <Route path="/product-exploration" element={<ProductExploration />} />
            <Route path="/loan-application" element={<LoanApplication />} />
            <Route path="/account-transaction-management" element={<AccountTransactionManagement />} />
            <Route path="/credit-card-application" element={<CreditCardApplication />} />
            <Route path="/account-users" element={<Accountusers />} />
            <Route path="/update-user-profile" element={<UpdateUserProfile />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
